import styled from 'styled-components';

export const ContainerHeader = styled.div`
    width: 100%;
    height: 10%;
    background: #131314;
    div{
        width: 100%;
        height: 100%;
        display: flex;
        justify-content: center;
        align-items: center;
        button{
            width: 150px;
            height: 30px;
            border-radius: 10px;
            margin: 0 3rem;
